"""
WalletAccountCashback
"""
type WalletAccountCashback {
  """
  Database identifier
  """
  id: ID!
  coupon: Coupon
  amount: CurrencyValue
  consumed: CurrencyValue
  currency: Currency
  """
  Date to expire this cashback. Formatted in the date format by adding hours in current date
  """
  expiresOn: Date
  expired: Boolean!
}
